How to Stop Your Nuisance Calls
Telephone fundraising has helped charities raise huge sums, with an estimated Ã‚Â£2billion amassed for good causes. However, this comes at a cost, as some of Britain's biggest charities are paying private companies to raise money on their behalf. Seyi Rhodes examines the increasing number of complaints being made about this method of collecting donations, and going inside call centres, undercover reporters find a sales-driven culture where some workers are pressured daily to meet targets.

